import styles from './Schedule.module.css';
import { Navigate } from "react-router-dom";


export default function ProtectedRoute({user, children}){

    if (!user){
        return Navigate('/Login')
    }

        return (
            <div className={styles.schedDiv}>
           children
            </div>
        )
}
